    var source= "src/DiceeChallenge/images/dice"+rnd1+".png";
    var source= "src/DiceeChallenge/images/dice"+rnd2+".png";
    return(
        <div class='game'>
        <body>
            <div class="container">
            <h1>Refresh Me!</h1>
            <div class="dice">
                <p>Player 1</p>
                <img class="img1" src={source}></img>
            </div>

            <div class="dice">
                <p>Player 2</p>
                <img class="img2" src={source}></img>
            </div>

            </div>    
        </body>    
        </div>
    );
}
export default DiceGame;
